import React from 'react'
import Web from '../src/images/img-3.png'
import { NavLink } from "react-router-dom"
import Common from './Common'

const About =() => {
    return(
      <>
      <Common 
      name="Welcome to About Us Page" 
      strong="About "
      imgsrc={Web} 
      visit="/contact" 
      btname="Contact Now"/>
      </>
    )
  }

  export default About;
